import React from 'react';

function myDic() {
  return (
    <div className="myDic">
      <div>
        <p>단어</p>
      </div>
      <div>
        <p>설명</p>
      </div>
      <div>
        <p>예시</p>
      </div>
    </div>
  );
}

export default myDic;
